BUILD:
- aarch64-conda_cos7-linux-gnu
binutils_version:
- '2.39'
cdt_arch:
- aarch64
cdt_name:
- cos7
channel_sources:
- conda-forge
channel_targets:
- conda-forge main
cross_target_platform:
- linux-64
docker_image:
- quay.io/condaforge/linux-anvil-cos7-x86_64
gcc_machine:
- x86_64
gcc_maj_ver:
- '12'
gcc_vendor:
- conda
gcc_version:
- 12.2.0
glib:
- '2'
glibc_version:
- '2.12'
libgfortran_soname:
- '5'
libgomp_ver:
- 1.0.0
old_gcc_vendor:
- conda_cos6
openmp_ver:
- '4.5'
target_platform:
- linux-aarch64
use_system_gcc:
- 'False'
zip_keys:
- - gcc_version
  - gcc_maj_ver
  - libgfortran_soname
- - glibc_version
  - old_gcc_vendor
  - gcc_machine
  - cross_target_platform
